// import React from "react"
import "./extension.css"



import React from "react";
import "rsuite/dist/rsuite.min.css";
import { Popover, Whisper, Dropdown, 
    Button } from "rsuite/";
  
const renderMenu = ({ left, top, className }, ref) => {
  
    return (
        <Popover ref={ref} 
            className={className} 
            style={{ left, top }} full>
            <Dropdown.Menu title="Create new file">
                <Dropdown.Item eventKey={1}>
                    Create new
                </Dropdown.Item>
                <Dropdown.Item eventKey={2}>
                    Export file
                </Dropdown.Item>
                <Dropdown.Item eventKey={3}>
                    Download file
                </Dropdown.Item>
            </Dropdown.Menu>
        </Popover>
    );
};
  
export default function Extension() {
    return (
        <center>
            <div class="DivDD" style={{ padding: 20 }}>
                
                <Whisper placement="bottomStart" 
                    trigger="click" speaker={renderMenu}>
                    <Button className="DDBtn" appearance="primary" color="blue">
                        Select Option
                    </Button>
                </Whisper>

                <Button className="DDBtn" appearance="primary" color="red">End Meeting</Button>
                <img src={require('./oldie.jpg')} width="800px" height="400px"></img>
            </div>
        </center>
    );
}
